import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.scss';
import Navigation from './Navigation/Navigation';
import Stack from './Stack/Stack';
import Queue from './Queue/Queue';

const App = () => {
		return (
			<>
				<BrowserRouter>
					<div className="main">
						<Navigation />
						<Queue />
					</div>
				</BrowserRouter>
			</>
		);
}

export default App;
